import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const SuperSimpleCalendarScreen = () => {
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Календарь операций</Text>
      <Text style={styles.subtitle}>Упрощенная версия</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#F5F5F5',
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  subtitle: {
    fontSize: 16,
    color: '#757575',
  },
});

export default SuperSimpleCalendarScreen;
